import React from 'react';
import { StyleSheet, Text, View, SafeAreaView, Button } from 'react-native';
import firebase from "firebase/compat/app"
import "firebase/compat/auth"
import "firebase/compat/firestore"
import Icon from 'react-native-vector-icons/Ionicons'
import EntypoIcon from 'react-native-vector-icons/Entypo'
import AntDesignIcon from 'react-native-vector-icons/AntDesign'
import { StatusBar } from 'expo-status-bar';
import { createDrawerNavigator, DrawerContentScrollView, DrawerItemList, DrawerItem } from '@react-navigation/drawer';
import { NavigationContainer } from '@react-navigation/native';
import HomeScreen1 from '../screens/HomeScreen1'
import SettingScreen from '../screens/SettingScreen'
import pageOne from '../screens/pageOne';
import pageTwo from '../screens/pageTwo';
import pageThree from '../screens/pageThree';
import pageFour from '../screens/pageFour';
import Profile from '../screens/Profile';
import Help from '../screens/help';
import Cart from '../screens/Cart';
import AuthNavigator from '../navigation/AuthNavigator';
import CheckOut from '../screens/CheckOut'

import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
const Tab = createBottomTabNavigator();

const Drawer = createDrawerNavigator();
function CustomDrawerContent(props) {
  return (
    <DrawerContentScrollView {...props}>
      <DrawerItemList {...props} />
      <DrawerItem
        icon={() => <AntDesignIcon name="logout" size={23} color={'#2E922E'} style={{ padding: 5 }} />}
        style={{ marginTop: '130%' }}
        label="Logout" onPress={() => {
          firebase.auth().signOut();
        }




        } />

    </DrawerContentScrollView>
  );
}
class HomeScreen extends React.Component {

  state = { user: {} };
  componentDidMount() {
    firebase.auth().onAuthStateChanged((user) => {
      if (user != null) {
        this.setState({ user: user });
      }
    })

  }
  render() {
    return (
      <NavigationContainer>
        <Drawer.Navigator initialRouteName="HomeScreen1" drawerContent={props => <CustomDrawerContent {...props} />}>

          <Drawer.Screen name="Shops" component={HomeScreen1}
            options={{
              title: 'Shops',
              drawerIcon: ({ focused, size }) => (
                <EntypoIcon name="shop" size={23} color={'#2E922E'} style={{ padding: 5 }} />
              ),
            }} />
          <Drawer.Screen name="Cart" component={Cart}
            options={{
              title: 'Cart',
              drawerIcon: ({ focused, size }) => (
                <AntDesignIcon name="shoppingcart" size={23} color={'#2E922E'} style={{ padding: 5 }} />
              ),
            }}
          />
          <Drawer.Screen name="Profile" component={Profile}
            options={{
              title: 'My Profile',
              drawerIcon: ({ focused, size }) => (
                <AntDesignIcon name="user" size={23} color={'#2E922E'} style={{ padding: 5 }} />
              ),
            }}
          />
          <Drawer.Screen name="Setting" component={SettingScreen}
            options={{
              title: 'Setting',
              drawerIcon: ({ focused, size }) => (
                <Icon name="settings" size={23} color={'#2E922E'} style={{ padding: 5 }} />
              ),
            }}
          />

          {/* <Drawer.Screen name="Help" component={Help}
 options={{  
  drawerItemStyle: { marginTop: '20%' }
}}
 />
  */}
          <Drawer.Screen name="pageOne" component={pageOne}
            options={{
              title: 'Al-Shini',
              drawerLabel: () => null
            }} />
          <Drawer.Screen name="pageTwo" component={pageTwo}
            options={{
              title: 'Bravo',
              drawerLabel: () => null
            }} />
          <Drawer.Screen name="pageThree" component={pageThree}
            options={{
              title: 'Brothers',
              drawerLabel: () => null
            }} />

          <Drawer.Screen name="pageFour" component={pageFour}
            options={{
              title: 'Gardens',
              drawerLabel: () => null
            }} />

          <Drawer.Screen name="CheckOut" component={CheckOut}
            options={{
              title: 'CheckOut',
              drawerLabel: () => null
            }} />

        </Drawer.Navigator>
      </NavigationContainer>
    );
  }

}
const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center'
  }
});
export default HomeScreen;
